import React from 'react';
import { FiAlertCircle } from 'react-icons/fi';
import { FaArrowLeft, FaArrowRight } from 'react-icons/fa';
import { MdKeyboardArrowDown, MdKeyboardArrowUp } from 'react-icons/md';
import { HiOutlineTag } from 'react-icons/hi';

import ImgMicrosoft from '../../assets/images/microsoft.png';

import Input from '../../components/inputs/index';
import Footer from '../../components/footer';
import HeaderEmpresa from '../../components/headerEmpresa';
import FotoAviso from '../../assets/images/Aviso.svg';
import Button from '../../components/Button';

import '../../global.css';
import './style.css';
import ModeloVaga from '../../components/ModeloVaga';
import { Link } from 'react-router-dom';
import HeaderAluno from '../../components/headerAluno';

function VagasEmpresa() {
    return (
        < >
            <HeaderEmpresa />
            <div className="mid">
                <div className="top">

                    <div className="arrowdois">
                        <Link to="/"><FaArrowRight color="black" size={24} /></Link>
                    </div>

                    <div id="head">
                        <h1>Seu perfil</h1>
                        <h1>Suas vagas</h1>
                    </div>
                    <div id="linhanav"></div>
                </div>


                <div className="Offvagas">
                    <div className="separar">
                        <img src={ImgMicrosoft} alt="" id="img" />
                        <h2>Titulo da vaga </h2>
                    </div>
                        <div className="dentro">
                        <MdKeyboardArrowDown size={24} />
                        </div>
                </div>

                <ModeloVaga />
            </div>
            <Footer />
        </>
    );
}

export default VagasEmpresa;
